import "./App.css";

import AutoCompleteText from "./AutoCompleteText/AutoCompleteText";

class App extends Component {

  render() {
    return (
      <div className="App">
        <div className="App-Component">
          <h1 className="App-title"> Search Greatest Footballers... </h1>
          <AutoCompleteText />
        </div>
      </div>
    );
  }
}

export default App;
